import React, { Component } from 'react';
import DriverList from './DriverList';
import TeamList from './TeamList';


class App extends Component {
    render() {
        return (
            <div>
                <h2>Drivers</h2>
                <DriverList/>
                <h2>Teams</h2>
                <TeamList/>
            </div>
        );
    }
}

export default App;
